import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { useEffect } from 'react';

export default function TrackableObject() {
  const paperStyle={padding:'50px 20px', width:600, margin:'20px auto'}
  const[trackableObjects, setTrackableObjects] = useState([])
  return (
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
      <TextField id="outlined-basic" label="Trackable Object Name" variant="outlined" />
      <TextField id="outlined-basic" label="Trackable Object Type " variant="outlined" />
    </Box>
  );

  useEffect(()=> {
    fetch("http://localhost:8080/trackableObject/getAll")
    .then(res=>res.json())
    .then((result)=>{
      setStudent(result);
    } )
  }
  )
}
